function screenshot(){
    html2canvas(document.getElementById("mBody")).then(function (canvas) {
        var link = document.createElement("a");
        document.body.appendChild(link);
        link.download = "tor-page1.jpg";
        link.href = canvas.toDataURL();
        link.target = '_blank';
        link.click();
    }); 

}

